import React from "react";
import { AiOutlineSearch } from "react-icons/ai";
function Links() {
  return (
    <div className="links">
      <h2>
        Links <AiOutlineSearch style={{ marginLeft: "12px" }} size="15" />
      </h2>
    </div>
  );
}

export default Links;
